import "./App.css";
import React from "react";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      id: 1,
      title: " milkshake",
      category: "breakfast",
      price: 15.99,
      img: "https://media.istockphoto.com/id/1323536801/photo/italian-frappe-isolated-on-white-background-gianduia-gelato-with-chocolate-topping-and-red.jpg?b=1&s=170667a&w=0&k=20&c=Fnw8T22h-gGE89mTvqygvCTs3NRJ6Nro5u2wgbMjxjk=",
      desc: `I'm baby woke mlkshk wolf bitters live-edge blue bottle, hammock freegan copper mug whatever cold-pressed `,
    };
  }
  render() {
    const { title, category, price, img, desc } = this.state;
    return (
      //card component
      <div>
        <Card sx={{ maxWidth: 345 }}>
          <CardMedia sx={{ height: 200 }} image={img} title={title} />
          <CardContent>
            <Typography gutterBottom variant="h5" component="div">
              {title}
            </Typography>
            <Typography variant="body2" color="text.secondary">
              {desc}
            </Typography>
            <Typography>${price}</Typography>
            <Typography>Category: {category}</Typography>
          </CardContent>
          <CardActions>
            <Button size="small">Add to Cart</Button>
          </CardActions>
        </Card>
      </div>
    );
  }
}

export default App;
